export interface CityCoordinates {
  latitude: number;
  longitude: number;
}

export async function GetCityCoordinates() {
  let response = await fetch(
    "https://api.api-ninjas.com/v1/geocoding?city=London&country=England"
  );

  if (!response.ok) {
    return null;
  }

  let responseData = (await response.json()) as CityCoordinates;
  console.log(response);
  return responseData;
}
